function K(e,n,i,c){if(i==n&&i==e)return .5;const a=n-e;let t=(i-e)/a;return c&&(t=l(0,1,t)),t}function l(e,n,i){return Math.max(Math.min(i,n),e)}function s(e,n,i){if(typeof e=="object")for(const c in e){const a=e[c];switch(typeof e[c]){case"object":const t=[];for(const o in n)t[o]=n[o][c];s(a,t,i);break;case"number":let f=0;for(const o in n)f+=n[o][c]*i[o];e[c]=f;break}}}function u(e,n,i,c){let a=0;for(const t in e){n[t]=0;for(const o in i){const y=i[o][t]||0,r=c[o];n[t]+=Math.abs(y-r)**3}const f=1/n[t];n[t]=f,a+=f}if(a!=1/0)for(const t in n){const f=t;n[f]/=a}else{let t=0;for(const f in n)n[f]==1/0&&t++;for(const f in n){const o=f;n[o]!=1/0?n[o]=0:n[o]=1/t}}}export{s as a,u as s,K as u};
